exports.init=function(config, app)
{
	app.use(function(cmd,next){
		if(cmd.text[0]=='(')
		//removing starting and ending paren
		cmd.text=cmd.text.substring(1,cmd.text.length-2);
		next();
	});
	app.use(function(cmd,next){
		if(cmd.text[cmd.text.length-1]=='\n')
		//removing \n
		cmd.text=cmd.text.substring(0,cmd.text.length);
		next();
	});

}